  function drawCourt() {
    const svg = d3.select("#court")
      .attr("width", width)
      .attr("height", height);

    const xScale = d3.scaleLinear()
      .domain([-470, 470])
      .range([0, width]);

    const yScale = d3.scaleLinear()
      .domain([-250, 250])
      .range([height, 0]);

    svg.append("rect")
      .attr("x", xScale(-470))
      .attr("y", yScale(250))
      .attr("width", xScale(470) - xScale(-470))
      .attr("height", yScale(-250) - yScale(250))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    // center circle
    svg.append("circle")
      .attr("cx", xScale(0))
      .attr("cy", yScale(0))
      .attr("r", xScale(60) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    // free throw circles
    svg.append("circle")
      .attr("cx", xScale(-280))
      .attr("cy", yScale(0))
      .attr("r", xScale(60) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("circle")
      .attr("cx", xScale(280))
      .attr("cy", yScale(0))
      .attr("r", xScale(60) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("rect")
      .attr("x", xScale(280))
      .attr("y", yScale(90))
      .attr("width", xScale(190) - xScale(0))
      .attr("height", yScale(-180) - yScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("rect")
      .attr("x", xScale(-470))
      .attr("y", yScale(90))
      .attr("width", xScale(190) - xScale(0))
      .attr("height", yScale(-180) - yScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(-430))
      .attr("y1", yScale(20))
      .attr("x2", xScale(-430))
      .attr("y2", yScale(-20))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(430))
      .attr("y1", yScale(20))
      .attr("x2", xScale(430))
      .attr("y2", yScale(-20))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("circle")
      .attr("cx", xScale(-410))
      .attr("cy", yScale(0))
      .attr("r", xScale(18) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("circle")
      .attr("cx", xScale(410))
