  function plotPoints() {
  const width = 940;
  const height = 500;

  const svg = d3.select("#court")
    .attr("width", width)
    .attr("height", height);

  const xScaleANT = d3.scaleLinear()
    .domain([-470, 470])
    .range([0, width]);

  const yScaleANT = d3.scaleLinear()
    .domain([-250, 250])
    .range([height, 0]);

  const xScaleMJ = d3.scaleLinear()
    .domain([-470, 470])
    .range([0, width]);

  const yScaleMJ = d3.scaleLinear()
    .domain([-250, 250])
    .range([height, 0]);

  const tooltip = d3.select("#tooltip")
    .style("opacity", 0)
    .style("position", "absolute")
    .style("background-color", "white")
    .style("border", "solid")
    .style("border-width", "2px")
    .style("border-radius", "5px")
    .style("padding", "5px")
    .style("text-align", "left");

  const mouseover = function(event, d) {
    tooltip.style("opacity", 1);
    d3.select(this).style("stroke", "black").style("opacity", 1);
  };

  const mousemove = function(event, d) {
    tooltip
      .html(`Distance: ${d.SHOT_ZONE_RANGE}<br>Quarter: ${d.PERIOD}<br>Time Remaining: ${d.TIME_REMAINING}`)
      .style("left", (event.pageX + 10) + "px")
      .style("top", (event.pageY - 10) + "px")
      .style("display", "block");
  };

  const mouseleave = function(event, d) {
    tooltip.style("opacity", 0).style("display", "none");
    d3.select(this).style("stroke", "none").style("opacity", 0.8);
  };

  svg.selectAll("circle.shot.ant")
    .data(ANTshotData)
    .enter()
    .append("circle")
    .attr("class", "shot ant")
    .attr("cx", d => xScaleANT(d.LOC_Y) - width / 2.25)
    .attr("cy", d => yScaleANT(d.LOC_X))
    .attr("r", 5)
    .style("fill", "#ce1141")
    .style("opacity", 0.6)
    .on("mouseover", mouseover)
    .on("mousemove", mousemove)
    .on("mouseleave", mouseleave);

  svg.selectAll("circle.shot.mj")
    .data(MJshotData)
    .enter()
    .append("circle")
    .attr("class", "shot mj")
    .attr("cx", d => xScaleMJ(-d.LOC_Y) + width / 2.25)
    .attr("cy", d => yScaleMJ(d.LOC_X))
    .attr("r", 5)
    .style("fill", "#0c2340")
    .style("opacity", 0.6)
    .on("mouseover", mouseover)
    .on("mousemove", mousemove)
    .on("mouseleave", mouseleave);
}
</script>

